function CustomForm({type, placeholder, onChange}) {
  return (
    <form className="">
      <div className="rounded-full border-4">
        <label className='flex flex-row'>
          <input
                type={type}
                placeholder={placeholder}
                className='text-center rounded-full h-[40px] w-[100%] text-base font-inter focus:outline-0'
                onChange={onChange}
                />  
          <button>HAPUS</button>
        </label>
      </div>
    </form>
  );
}

export default CustomForm;
